      // \ub610\ud55c \uc774\ub7ec\ud55c \ubc29\ubc95\ub3c4 \uc788\ub2e4.\n        inputField.onValueChanged.AsObservable().Subscribe();\n        \n        // \uc774 \ub450 \uae30\ubc95\uc758 \ucc28\uc774\ub294 Subscribe\uc2dc \ud604\uc7ac \uac12\uc758 \ucd08\uae30 \uac12\uc758 \ubc1c\ud589 \uc5ec\ubd80\uc774\ub2e4\n        // Subscribe\uc2dc \ucd08\uae30 \uac12\uc774 \ud544\uc694\ud55c \uacbd\uc6b0\ub294 \uc804\uc790\ub97c \uc0ac\uc6a9\ud558\uba74 \ub41c\ub2e4.\n        inputField.OnValueChangedAsObservable(); // \ucd08\uae30\uac12\uc774 \uc788\ub2e4.\n        inputField.onValueChanged.AsObservable(); // \ucd08\uae30\uac12\uc774 \uc5c6\ub2e4.\n    }\n}\n')),(0,a.kt)("h2",{id:"\uae30\ud0c0"},"\uae30\ud0c0"),(0,a.kt)("p",null,"UniRx\ub294 \uc774\uc678\uc5d0\ub3c4 \ud3b8\ub9ac\ud55c \uc2a4\ud2b8\ub9bc \uc18c\uc2a4\ub97c \uc81c\uacf5 \ud574\uc8fc\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uadf8 \uc911 \uc77c\ubd80\ub97c \uc18c\uac1c\ud558\uaca0\uc2b5\ub2c8\ub2e4."),(0,a.kt)("h3",{id:"observablewww"},"ObservableWWW"),(0,a.kt)("p",null,(0,a.kt)("inlineCode",{parentName:"p"},"ObservableWWW"),"\ub294 Unity\uc758 ",(0,a.kt)("inlineCode",{parentName:"p"},"WWW"),"\ub97c \uc2a4\ud2b8\ub9bc\uc73c\ub85c \ucc98\ub9ac \ud560 \uc218 \uc788\ub3c4\ub85d \ub798\ud551 \ud574 \uc900 \uac83\uc785\ub2c8\ub2e4. \ud638\ucd9c\ud558\ub294 \uac83\uc73c\ub85c UniRx\ub294 \ucf54\ub8e8\ud2f4\uc744 \uc2e4\ud589\ud574 WWW\ub97c \ucc98\ub9ac\ud558\uace0 \uacb0\uacfc\ub9cc \uc54c\ub824\uc90d\ub2c8\ub2e4."),(0,a.kt)("pre",null,(0,a.kt)("code",{parentName:"pre",className:"language-cs"},'ObservableWWW.Get("https://google.com")\n            .Subscribe(x => Debug.Log(x));\n')),(0,a.kt)("p",null,"(UniRx\ub294 \ub0b4\ubd80\uc5d0 \ucf54\ub8e8\ud2f4\uc744 \uac00\uc9c0\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uadf8 \uc2e4\uccb4\uac00 \ub418\ub294 GameObject\ub294 MainThreadDispacher \ub77c\ub294 \uc774\ub984\uc73c\ub85c \uc52c\uc5d0 \uc874\uc7ac\ud569\ub2c8\ub2e4. \uc774 MainThreadDispatcher\ub97c \uba48\ucd94\uba74 UniRx\uac00